require 'zip'
require 'base64'
require 'tempfile'

CONTENT = ""

def decode(base64)
  zip_buffer = Base64.decode64(base64)
  export = nil

  Tempfile.create do |tempfile|
    tempfile.binmode
    tempfile.write(zip_buffer)
    tempfile.rewind

    Zip::File.open(tempfile) do |zip_file|
      export = zip_file.find_entry("export.r2x").get_input_stream.read
    end
  end

  export
end


decode(CONTENT)
